oxy_webhelp_navlinks = {"vs_virtual_machines-d23139e19815":{"topics":[{"title":"vSphere VM templates","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">Rubrik Security Cloud<\/span> support selected backup and recovery operations for vSphere         VM templates and content library items. These operations include file recovery, export, live         mount, mounting virtual disks, and recovering virtual machine images as a         template.<\/p>","href":"saas\/vs_vm_templates.html","attributes":{"data-id":"vs_vm_templates"},"menu":{"hasChildren":false},"tocID":"vs_vm_templates-d23139e19828","topics":[]},{"title":"Application consistency","shortdesc":"<p class=\"shortdesc\">You can set application consistency for vSphere virtual machines individually or in         batch at different levels in the vSphere hierarchy.<\/p>","href":"saas\/vs_app_consistency_indiv_batch.html","attributes":{"data-id":"vs_app_consistency_indiv_batch"},"menu":{"hasChildren":false},"tocID":"vs_app_consistency_indiv_batch-d23139e19841","next":"vs_app_consistency_indiv_batch-d23139e19841"},{"title":"vSphere virtual machine protection","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> provides protection for virtual machines through individual assignment of the         virtual machine to an SLA Domain or through automatic protection.<\/p>","href":"saas\/vs_virtual_machine_protection.html","attributes":{"data-id":"vs_virtual_machine_protection"},"menu":{"hasChildren":false},"tocID":"vs_virtual_machine_protection-d23139e19877","next":"vs_virtual_machine_protection-d23139e19877"},{"title":"vSphere management","shortdesc":"<p class=\"shortdesc\">The Rubrik cluster accesses virtual machine data through a connection with the VMware         vCenter Server or ESXi host that manages the hypervisor running the virtual         machine.<\/p>","href":"saas\/vs_vsphere_management.html","attributes":{"data-id":"vs_vsphere_management"},"menu":{"hasChildren":false},"tocID":"vs_vsphere_management-d23139e20004","next":"vs_vsphere_management-d23139e20004"},{"title":"vSphere diagnostics","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">Rubrik Security Cloud<\/span> vSphere diagnostics confirm connectivity and access         permissions for a vCenter server connected to a Rubrik cluster. You can use vSphere         diagnostics to verify and troubleshoot connectivity, backup, and recovery of a vSphere         object or component.<\/p>","href":"saas\/vs_vsphere_diagnostics.html","attributes":{"data-id":"vs_vsphere_diagnostics"},"menu":{"hasChildren":false},"tocID":"vs_vsphere_diagnostics-d23139e20256","next":"vs_vsphere_diagnostics-d23139e20256"},{"title":"VMware Cloud on AWS","shortdesc":"<p class=\"shortdesc\">A Rubrik Cloud Cluster can protect virtual machines deployed on VMware Cloud on         AWS.<\/p>","href":"cdm\/vmware_cloud_on_aws.html","attributes":{"data-id":"vmware_cloud_on_aws"},"menu":{"hasChildren":false},"tocID":"vmware_cloud_on_aws-d23139e20280","next":"vmware_cloud_on_aws-d23139e20280"},{"title":"Microsoft Azure VMware Solution","shortdesc":"<p class=\"shortdesc\">A Rubrik cluster can protect virtual machines deployed on the Microsoft Azure VMware         Solution.<\/p>","href":"cdm\/vmware_cloud_on_azure.html","attributes":{"data-id":"vmware_cloud_on_azure"},"menu":{"hasChildren":false},"tocID":"vmware_cloud_on_azure-d23139e20335","next":"vmware_cloud_on_azure-d23139e20335"},{"title":"Google Cloud VMware Engine","shortdesc":"<p class=\"shortdesc\">A Rubrik cluster can protect virtual machines deployed on the Google Cloud VMware         Engine.<\/p>","href":"cdm\/vmware_cloud_on_gcve.html","attributes":{"data-id":"vsphere_on_gcve"},"menu":{"hasChildren":false},"tocID":"vsphere_on_gcve-d23139e20390","next":"vsphere_on_gcve-d23139e20390"},{"title":"VMDK files","shortdesc":"<p class=\"shortdesc\">Virtual machines can include VMDK files that do not need to be protected.<\/p>","href":"saas\/vs_vmdk_files.html","attributes":{"data-id":"vs_vmdk_files"},"menu":{"hasChildren":false},"tocID":"vs_vmdk_files-d23139e20445","next":"vs_vmdk_files-d23139e20445"},{"title":"vSphere virtual machine scripts","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> allows you to configure the Rubrik cluster to run scripts on a         guest OS before a snapshot, after a snapshot, and after the Rubrik cluster completes the         backup process.<\/p>","href":"saas\/vs_virtual_machine_scripts.html","attributes":{"data-id":"vs_virtual_machine_scripts"},"menu":{"hasChildren":false},"tocID":"vs_virtual_machine_scripts-d23139e20467","next":"vs_virtual_machine_scripts-d23139e20467"},{"title":"Rubrik Backup Service","shortdesc":"<p class=\"shortdesc\">The Rubrik Backup Service is software installed on a host that coordinates activity         between the Rubrik cluster and the host.<\/p>","href":"saas\/rubrik_backup_service.html","attributes":{"data-id":"rubrik_backup_service"},"menu":{"hasChildren":false},"tocID":"rubrik_backup_service-d23139e20503","next":"rubrik_backup_service-d23139e20503"},{"title":"On-demand snapshots of vSphere virtual machines","shortdesc":"<p class=\"shortdesc\">In addition to policy-based snapshots, create virtual machine snapshots by using the         on-demand snapshot process.<\/p>","href":"saas\/vs_ods.html","attributes":{"data-id":"vs_ods"},"menu":{"hasChildren":false},"tocID":"vs_ods-d23139e20553","next":"vs_ods-d23139e20553"},{"title":"vSphere virtual machine details page","shortdesc":"<p class=\"shortdesc\">The vSphere virtual machine details page provides detailed information about the         virtual machine, protection of the virtual machine, available snapshots, and tasks related         to the virtual machine and snapshots.<\/p>","href":"saas\/vs_vm_details_page.html","attributes":{"data-id":"vs_vm_details_page"},"menu":{"hasChildren":false},"tocID":"vs_vm_details_page-d23139e20575","next":"vs_vm_details_page-d23139e20575"},{"title":"Recovery of vSphere virtual machines","shortdesc":"<p class=\"shortdesc\">To recover a vSphere virtual machine, a Rubrik cluster mounts a point-in-time copy of         that virtual machine.<\/p>","href":"saas\/vs_recovery_vm.html","attributes":{"data-id":"vs_recovery_vm"},"menu":{"hasChildren":false},"tocID":"vs_recovery_vm-d23139e20663","next":"vs_recovery_vm-d23139e20663"},{"title":"Storage array integration","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">Rubrik Security Cloud<\/span> provides a user interface for integrating Rubrik         clusters with storage arrays, reducing the time a virtual machine is quiescent during         snapshot operations.<\/p>","href":"saas\/vs_storage_array_integration.html","attributes":{"data-id":"vs_storage_array_integration"},"menu":{"hasChildren":false},"tocID":"vs_storage_array_integration-d23139e20934","next":"vs_storage_array_integration-d23139e20934"},{"title":"Continuous Data Protection","shortdesc":"<p class=\"shortdesc\">Continuous Data Protection uses VMware vSphere APIs for I\/O Filtering to continuously     capture changes to data on a vSphere virtual machine and sends them to a Rubrik     cluster.<\/p>","href":"cdm\/vs_vm_continuous_data_protection.html","attributes":{"data-id":"vs_vm_continuous_data_protection"},"menu":{"hasChildren":false},"tocID":"vs_vm_continuous_data_protection-d23139e21027","next":"vs_vm_continuous_data_protection-d23139e21027"},{"title":"Standalone ESXi host protection","shortdesc":"<p class=\"shortdesc\">Rubrik supports protecting and restoring virtual machines on standalone ESXi hosts,         providing continuous data security in environments that do not include a vCenter         server.<\/p>","href":"saas\/standalone_esxi_host_protection.html","attributes":{"data-id":"standalone_esxi_host_protection"},"menu":{"hasChildren":false},"tocID":"standalone_esxi_host_protection-d23139e21096","next":"standalone_esxi_host_protection-d23139e21096"}]}};